eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"loane1\": function() { return /* binding */ loane1; },\n/* harmony export */   \"loane2\": function() { return /* binding */ loane2; },\n/* harmony export */   \"loane3\": function() { return /* binding */ loane3; },\n/* harmony export */   \"loane4\": function() { return /* binding */ loane4; },\n/* harmony export */   \"loane5\": function() { return /* binding */ loane5; }\n/* harmony export */ });\nconst loane1 = [{\n  title: 'Background',\n  description: 'The SDSC Summer Development Internship was a 12 week long program aimed to expose future software engineers and designers to common development practices. During the internship, my team and I worked within an agile development framework, which consisted of daily scrum meetings and 5 total sprintsincluding sprint planning, sprint reviews, sprint retrospectives, and sprint cleaning.',\n  description1: 'As an Organized Research Unit of UC San Diego, the San Diego Supercomputer Center (SDSC) is considered a leader in data-intensive computing and cyberinfrastructure, providing resources, services, and expertise to the national research community including industry and academia.',\n  source: 'Loane',\n  id: 0\n}, {\n  title: 'Role',\n  description: \"I worked primarily as a UX/UI designer and front-end developer for the duration of our project, working closely with Adobe XD and React Native. I also dabbled in some back-end development, which exposed me to some Firebase. This internship was my first exposure to front-end development and UX/UI design aspects of app development. It pushed me to learn new development frameworks (React Native) and the necessary tools/skills needed for UX/UI design (Adobe XD, wireframing, protoyping, etc.), all within a span of 10 weeks.\",\n  source: 'https://google.com',\n  id: 1\n}];\nconst loane2 = [{\n  title: 'User/Developer Stories and CoS (Conditions of Satisfaction) Samples ',\n  image: ' ',\n  description: 'As a user, I want the ability to visualize how much money I am spending each month and the specific categories I am spending in',\n  description1: 'CoS: tab that shows you that information',\n  description2: 'CoS: dashboard on the tab that shows graphs using Tableau',\n  description3: 'CoS: has sliders so users can change specific values',\n  description4: 'As a user, I want UI friendly app so it is easy to navigate',\n  description5: 'CoS: looks visually appealing',\n  description6: 'CoS: looks minimalistic and clean',\n  description7: 'CoS: not too crowded',\n  description8: 'CoS: potentially have option for dark mode',\n  description9: 'As a user, I want to see my total loans so that I can clearly see how much I owe',\n  description10: 'CoS: landing page of the app',\n  description11: 'CoS: have its own tab as well',\n  description12: 'CoS: need a way to enter how many loans you took out and info about loans',\n  description13: 'CoS: a way to change info for person',\n  description14: 'CoS: way to see how much each individual type of loan is contributing',\n  description15: 'CoS: way to see changes over time',\n  description16: 'CoS: log for all the entries you have made',\n  description17: 'As a developer, I want a way to get feedback from users',\n  description18: 'CoS: button where users can send messages about features that are not working',\n  id: 0\n}, {\n  image: '../../images/Loane/loane_wireframes.png',\n  description19: 'With user stories and CoS in mind, I designed a low-fidelity wireframe of our app.',\n  id: 1\n}];\nconst loane3 = [{\n  title: 'SPRINT 2-3 (WEEKS 5-6)',\n  description: 'Sprint 2 was the start of the development process; my primary tasks during these two sprints was to develop the Resources and Profile/Settings page in accordance with the prototype. However, the functionality of the Resources page deviated from our original prototype after taking into account code efficiency/effectiveness, but I believe the changes made the page easier for users to navigate. The profile/settings page was replicated fairly well and looked like how we envisioned it. These two sprints were also filled with lots of debugging and fixing navigation issues.',\n  source: 'Loane',\n  id: 0\n}, {\n  title: '',\n  image: 'https://google.com',\n  id: 1\n}];\nconst loane4 = [{\n  title: '',\n  source: 'Loane',\n  id: 0\n}, {\n  title: 'SPRINT 4 (WEEKS 9-10)',\n  description: 'Because each team member worked on their individual tasks (adding a bunch of cool features to each page), each page was inconsistent in terms of color scheme and layout. Because of this, I had to do a complete UI redesign of each screen so the interface would look cleaner and more seamless for users. Of course, because the hi-fi prototype wasn\\'t all-encompassing, it was important to stay flexible as we built off of our prototype and made sure our new features and pages stayed consistent with the colors and layout. Besides redesigning the UI, I also worked with some Firebase to make sure the user\\'s name would properly display on their profile page.',\n  source: 'Loane',\n  id: 0\n}];\nconst loane5 = [{\n  title: 'SPRINT 5 (WEEKS 11-12)',\n  description: 'This final sprint was dedicated to making the final touches on the UI, finishing up the implementations of certain features, and cleaning up our code. We decided to scrap certain functionalities of the app because of our time restraints; collectively, we got rid of a main screen/dashboard and the awards feature on the profile pageso I had to redo the interace of this page. Since we had also scrapped certain setting options, such as being able to change the theme or turn on notifications, I was able to move the leftover settings onto the profile page. Side note, another cool implementation I worked on was to use an expo module, expo-image-picker, to allow users to choose a profile picture from their camera roll, which would then be stored in firebase so it would appear each time they  are logged in. Steven, who worked primarily on the budgeting page, also changed it up from our original prototype (he got rid of the ability to set a spending max), but was able to link each of the user\\'s spendings to the budgeting page, which I think is super amazing!',\n  source: 'Loane',\n  id: 0\n}, {\n  title: '',\n  source: 'Loane',\n  id: 0\n}];//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/components/Loane/LoaneConstants.js\n");

